import { useEffect,useState} from "react";
import axios from 'axios';
const Main=async()=>{
    useEffect(()=>{
        async function fetch(){
            const profile = await axios.get(`http://localhost/profile`);

        }
    })
    console.log(profile);
}
export default Main;
